import React from "react";
import { NavLink } from "react-router-dom";

const Menu = () => {
  return (
    <>
      <NavLink exact={true} activeClassName="current" to="/">
        React About Us
      </NavLink>
      <NavLink activeClassName="current" to="/contact">
        React Contact Us
      </NavLink>
      <br />

      <a href="/"> About Us</a>
      <a href="/contact"> Contact Us</a>
    </>
  );
};

export default Menu;
